import React, { useEffect } from "react";
import { motion } from "framer-motion";
import "./Home.css";
function Home() {
  return (
    <>
      <motion.div>
        className="box" animate=
        {{
          scale: [1, 2, 2, 1, 1],
          rotate: [0, 0, 180, 180, 0],
          borderRadius: ["0%", "0%", "50%", "50%", "0%"],
        }}
        transition=
        {{
          duration: 2,
          ease: "easeInOut",
          times: [0, 0.2, 0.5, 0.8, 1],
          repeat: Infinity,
          repeatDelay: 1,
        }}
        <div className="home">
          <div className="container">
            <h1 className="title">ME-Ring</h1>
            <p className="description">
              Lorem Ipsum Lorem IpsumLorem IpsumLorem IpsumLorem Ipsum. Lorem
              IpsumLorem IpsumLorem IpsumLorem IpsumLorem IpsumLorem Ipsum Lorem
              IpsumLorem IpsumLorem IpsumLorem IpsumLorem IpsumLorem Ipsum.
            </p>
          </div>
          <div className="home__image"> </div>
        </div>
      </motion.div>
    </>
  );
}
export default Home;
